import { Expand } from "@mui/icons-material";
import { React, useEffect, useState, useRef } from "react";

const Stories = () => {
  const [IsLoading, setIsLoading] = useState(false);
  const [Users, fetchUsers] = useState([]);

  const focusPoint = useRef(null);
  // let API =
  //   "https://newsapi.org/v2/top-headlines?country=us&category=&apiKey=fe415a344cea4034bef041fac54c308c";

  // const fetchApiData = async (url) => {
  //   try {
  //     const res = await fetch(url);
  //     let data = await res.json();
  //     setIsLoading(false);
  //     fetchUsers(data);
  //     console.log("fetchApiData==>", data);
  //   } catch (error) {
  //     console.log("fetchApiData error ==>", error);
  //   }
  // };

  const getData = () => {
    fetch(
      `https://newsapi.org/v2/top-headlines?country=us&category=&apiKey=fe415a344cea4034bef041fac54c308c`
    )
      .then((res) => res.json())
      .then((res) => {
        setIsLoading(false);
        console.log("fetch API:===>>>>", res.articles);
        fetchUsers(res.articles);
      });
  };

  useEffect(() => {
    setTimeout(() => {
      JSON.stringify(getData(), null, 2);
      // getData();
    }, 2000);
  }, []);

  if (IsLoading) {
    return (
      <>
        <h1>Loading...</h1>
      </>
    );
  }
  const onClickHandler = () => {
    focusPoint.current.value = "The quick brown fox jumps over the lazy dog";
    // focusPoint.current.focus();
  };

  var array = ['how', 'are', 'you', 'doing', 'today', '?'];

  for (let index = 0; index < array.length; index++) {
    const element = array[index];
    console.log('element=><>>', element);

  }

  for (let num = 0; num <= 10; num++) {
    const element = 9;
    console.log(element + "*" + num + "=" + element * num);
  }
  const months = ['jan', 'march', 'april', 'may', 'june'];
  const example = months.indexOf('june');

  if (example !== -1) {
    const updateMonths = months.splice(example, 1);
    console.log('example=======>>', example);
    console.log('example=ssssss====>>', updateMonths)
  }

  return (
    <div>

      {Users.map((item, i) => {
        console.log("dd==>>>>>>>>>>>>>>", item.title);
        return <div key={i}>{item.title}</div>;
      })}

      <button onClick={onClickHandler}>ACTION</button>
      <label>Click on the action button to focus and populate the text.</label>
      <br />
      <textarea ref={focusPoint} />
    </div>

  );
};

export default Stories;
